import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';
import { errorRoute } from './layouts/error/error.route';
import { navbarRoute } from './layouts/navbar/navbar.route';
import { DEBUG_INFO_ENABLED } from 'app/app.constants';

const LAYOUT_ROUTES = [navbarRoute, ...errorRoute];

@NgModule({
  imports: [

    RouterModule.forRoot(
      [
        {
          path: '',
          redirectTo: 'inbox',
          pathMatch: 'full'
        },
        {
          path: 'enquiry',
          loadChildren: () => import('./enquiry/enquiry-routing.module').then(m => m.EnquiryRoutingModule),
        },
        {
          path: 'administration',
          loadChildren: () => import('./administration/administration-routing.module').then(m => m.AdministrationRoutingModule),
        },
        {
          path: 'payroll',
          loadChildren: () => import('./payroll/payroll-routing.module').then(m => m.PayrollRoutingModule),
        },
        {
          path: 'admin',
          loadChildren: () => import('./admin/admin-routing.module').then(m => m.AdminRoutingModule),
        },
        {
          path: 'account',
          loadChildren: () => import('./account/account.module').then(m => m.AccountModule),
        },
        {
          path: 'login',
          loadChildren: () => import('./login/login.module').then(m => m.LoginModule),
        },
        {
          path: 'report-letter',
          loadChildren: () => import('./report-letter/report-letter-routing.module').then(m => m.ReportLetterRoutingModule),
        },
        {
          path: 'payment',
          loadChildren: () => import('./payment/payment-routing.module').then(m => m.PaymentRoutingModule),
        },
        {
          path: '',
          loadChildren: () => import('app/workload/workload.module').then(m => m.WorkloadModule),
        },
        {
          path: 'claim',
          loadChildren: () => import('./claim/claim-routing.module').then(m => m.ClaimRoutingModule),
        },
        // {
        //   path: 'inbox',
        //   loadChildren: () => import('app/workload/workload-inbox-routing.module').then(m => m.WorkloadInboxRoutingModule),
        // },
        ...LAYOUT_ROUTES,
      ],
      { enableTracing: DEBUG_INFO_ENABLED }
    ),
  ],
  exports: [RouterModule],
})
export class AppRoutingModule { }
